import React, { Component } from "react";
import PropTypes from "prop-types";

/*
  This is the root component of your app. Here you define the overall layout
  and the container of the react router.
  You should adjust it according to the requirement of your app.
*/
export default class App extends Component {
  constructor(props) {
    super(props);
    const ironMan =
      "data:image/jpeg;base64,";
    const captAm =
      "data:image/jpeg;base64,";
    const blackWidow =
      "data:image/jpeg;base64,";
    const hulk =
      "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcRC1gZJiacaIwMN1FE4SJty73tZFOGAr-vg8rG3hpLYpe8O43_v";
    const scarlet =
      "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcSg3PS2Xi5lvtRhSPvLqXJoC5FiDl5_adPikCv1Tj3bXOJOwO_p";
    const hawkeye =
      "data:image/jpeg;base64,";
    const thor =
      "data:image/jpeg;base64,";
    const spiderman =
      "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcQRSjsBX8pMO7lr5nXr2AacWq5gGuIXU6fwE4hMKCcJfqxAIv5u";
    const marvel =
      "data:image/jpeg;base64,";
    const groot =
      "data:image/jpeg;base64,";
    const rocket =
      "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcTcr8AXyZZo3-BZ6GC0nEL_k49-Lj4__5S099yCQohQpDqHg8MT";
    const panther =
      "data:image/jpeg;base64,";
    this.state = {
      selected: [],
      selectedCount: 0,
      board: [
        ironMan,
        captAm,
        blackWidow,
        hulk,
        scarlet,
        hawkeye,
        thor,
        spiderman,
        marvel,
        groot,
        rocket,
        panther
      ]
    };
  }
  static propTypes = {
    children: PropTypes.node
  };

  static defaultProps = {
    children: ""
  };

  shuffle(array) {
    var currentIndex = array.length,
      temporaryValue,
      randomIndex;

    while (0 !== currentIndex) {
      randomIndex = Math.floor(Math.random() * currentIndex);
      currentIndex -= 1;

      temporaryValue = array[currentIndex];
      array[currentIndex] = array[randomIndex];
      array[randomIndex] = temporaryValue;
    }

    return array;
  }

  handleClick(image) {
    if (0 === this.state.selected.length) {
      var joined = this.state.selected.concat(image);
      this.setState({
        board: this.shuffle(this.state.board),
        selected: joined,
        selectedCount: this.state.selectedCount + 1
      });
    } else {
      let found = false;
      let index = 0;
      while (index < this.state.selected.length) {
        if (image === this.state.selected[index]) {
          found = true;
          break;
        }
        index++;
      }

      if (found) {
        this.setState({
          board: this.shuffle(this.state.board),
          selected: [],
          selectedCount: 0
        });
      } else {
        let joined = this.state.selected.concat(image);
        this.setState({
          board: this.shuffle(this.state.board),
          selected: joined,
          selectedCount: this.state.selectedCount + 1
        });
      }
    }

    if (this.state.selected.length + 1 === this.state.board.length) {
      alert("---Winner!!!---");
    }
  }

  renderBoard() {
    const items = [];

    for (const [index, value] of this.state.board.entries()) {
      if (index === 4) {
        items.push(<br />);
      }
      items.push(
        <Square url={value} onClick={() => this.handleClick(value)} />
      );
    }
    return items;
  }

  render() {
    let status;

    status = "User score is: " + this.state.selectedCount;

    return (
      <div className="home-app">
        <div>{status}</div>
        {this.renderBoard()}
      </div>
    );
  }
}

function Square(props) {
  return (
    <button onClick={props.onClick}>
      <img alt="" src={props.url} />
    </button>
  );
}
